import React from 'react';

function Header() {
  return (
    <header className="header">
      <div className="left-side">
        <input className="search-bar" type="text" placeholder="Search" />
        <button className="search-button">
          {/* <img className="search-icon" src="icons/search.svg" alt="Search Icon" /> */}
          <div className="tooltip">Search</div>
        </button>
        {/* 
        <button className="voice-search-button">
          <img className="voice-search-icon" src="icons/voice-search-icon.svg" alt="Voice Search" />
          <div className="tooltip">Search with voice</div>
        </button>
        */}
      </div>

      <div className="right-side">
        {/* Add any additional content here */}
        <button className='register-button'>Зарегестрироваться</button>
        <button className='login-button'>Войти</button>
      </div>
      
    </header>  
  );
}

export default Header;
